import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Header = () => {
    return (
        <View style={styles}>
            <View></View>
        </View>
    );
}

const styles = StyleSheet.create({
    headreContainer: {
        backgroundColor: "#fff",
        width: '100%',
        height: '100vh',
    }
})

export default Header;
